const getGoogleSheetData = async (url) => {
  const data = await fetch(url).then((res) => res.text());

  console.log(
    data
      .replace("google.visualization.Query.setResponse(", "")
      .replace("/*O_o*/", "")
      .replace("\n", "")
      .replace(");", "")
  );

  return data
    .replace("google.visualization.Query.setResponse(", "")
    .replace("/*O_o*/", "")
    .replace("\n", "")
    .replace(");", "");
};

export default getGoogleSheetData;
